import React from "react";
import styled from "styled-components";
const UL = styled.ul`
    margin: 0;
    padding: 0;
    background-color: #405cc1;
    color: white;
`;
const List = ({ day, children }) => {
    return (
        <UL>
            <p>{day}</p>
            {children}
        </UL>
    );
};

export default List;
